Let $B$ and $J$ represent the ages of Billy and Joe, respectively. We have the following two equations:

\begin{align*}
B &= 2J\\
B+J &= 45
\end{align*}

We can use substitution to solve for $B$ in terms of $J$. From the first equation, we have $B = 2J$. Substituting this into the second equation, we get:

\begin{align*}
2J+J &= 45\\
3J &= 45\\
J &= 15
\end{align*}

So Joe is 15 years old. To find Billy's age, we can use the first equation:

\begin{align*}
B &= 2J = 2(15)\\
B &= 30
\end{align*}

Therefore, Billy is $\boxed{30}$ years old.

