[/asy]

gpt_chatgpt_fewshot_solution:
Since triangles $BAD$ and $BDC$ are both right triangles, we can apply the Pythagorean theorem to find $AD$ and $CD$: \begin{align*}
AD &= \sqrt{BD^2 - AB^2} = \sqrt{15^2 - 12^2} = 9, \\
CD &= \sqrt{BD^2 - BC^2} = \sqrt{15^2 - 17^2} = 8.
\end{align*}

Now, we can split quadrilateral $ABCD$ into two right triangles, $ABD$ and $BCD$, and a rectangle with width $AD$ and length $BC$: [asy]
draw((0,0)--(9,0)--(9,0)+8dir(36.87)--(0,12)--cycle,linewidth(1));
draw((0,12)--(9,0),linewidth(1));
draw((0,0)--(0,12),dashed);
label("A",(0,0),SW);
label("B",(0,12),W);
label("C",(9,0)+8dir(36.87),NE);
label("D",(9,0),S);
