label("$8$",(9,0)+8dir(36.87)--(0,12),W);
[/asy] The area of triangle $ABD$ is $\frac{1}{2}(AB)(AD) = 54$ square units. The area of triangle $BCD$ is $\frac{1}{2}(BC)(CD) = 68$ square units. The area of the rectangle is $(AD)(BC) = 72$ square units. Therefore, the area of quadrilateral $ABCD$ is $54 + 68 + 72 = \boxed{194}$ square units.

