Since $AB \perp BC$ and $AC$ is a transversal, we have $\angle BAC = 90^\circ$. Similarly, $\angle BDC = 90^\circ$. Therefore, $\triangle ABE$ and $\triangle CDE$ are both right triangles. 

Using the Pythagorean Theorem, we can find the length $BE$ as:

\begin{align*} BE &= \sqrt{AB^2 + AE^2} \\ &= \sqrt{AB^2 + AC^2 - EC^2} \\ &= \sqrt{9^2 + 12^2 - 4^2} \\ &= \sqrt{125} \\ &= 5\sqrt{5} \text{ cm} \end{align*}

Similarly, we can find the length $DE$ as:

\begin{align*} DE &= \sqrt{DC^2 + CE^2} \\ &= \sqrt{DC^2 + AC^2 - AE^2} \\ &= \sqrt{4^2 + 12^2 - 4^2} \\ &= \sqrt{128} \\ &= 8\sqrt{2} \text{ cm} \end{align*}

Now we can find the perimeter of the trapezoid by adding up the lengths of all four sides:

\begin{align*} AB + BE + CD + DE &= 9 + 5\sqrt{5} + 12 + 8\sqrt{2} \\ &= 21 + 5\sqrt{5} + 8\sqrt{2} \text{ cm} \end{align*}

Therefore, the perimeter of quadrilateral $ABCD$ is $21 + 5\sqrt{5} + 8\sqrt{2}$ cm.

